    false,nt"url": null,nt"notes": "This is the 1995 Annual Narrative Report
    for Malheur National Wildlife Refuge.  The report begins by describing the yearu2019s
    highlights and climatic conditions.  Land acquisition is discussed next, followed
    by refuge planning.  Administration is covered in the following section; a list
    of personnel is given as well as information about volunteer programs and funding.
     Habitat management is discussed next; habitats include wetlands, croplands, grasslands,
    and other habitats.  Grazing, haying, fire management, pest control, and water rights
    are also discussed in the habitat management section.  Wildlife is covered in the
    following section.  Animals of interest include waterfowl, marsh birds, shorebirds,
    raptors, other migratory birds, game mammals, and fish.  Public uses of the refuge;
    such as outdoor classrooms, hunting, and fishing; are discussed next.  Equipment
    and facilities are also described- activities include new construction, maintenance,
    and equipment replacement.",nt"license_title": "License Not Specified",nt"extras":
